import logo from './logo.svg';
import './App.css';
import Face from './Face.js';


function App() {
  return (
    <div className="App">
      <h1>Smiley face but now we're in React</h1>
      <Face
        svgWidth = { 960 }
        svgHeight = { 500 }
        centerX = { svgWidth/2 }
        centerY = { svgHeight/2 }
        strokeWidth = { 30 }
        eyeOffsetX = { 100 }
        eyeOffsetY = { 50 }
        eyeRadius = { 20 }

        mouthWidth = { 90 }
        mouthRadius = { 100 }
      />
    </div>
  );
}

export default App;
